        </div>
        <div className="main-content">
            <h1>WORK HARD TO HAVE A GOOD RESULT</h1>
            <h5>Excellence is the gradual result of always striving to do better - <strong>Pat Riley</strong> </h5>
        </div>
         </div>
        
